import {Routes,Route} from "react-router-dom";
import './App.css';
import Decoration from './Composants/Decoration';
import Menu from './Composants/Menu';

function ModalWindow(){
  return (
      <div className="modal-window">

            <div className="fermer">
                <p>x</p>
            </div>
            {/*<h1>Welcome</h1>
            <h3>To Our Application</h3> */}
            <h4>My Identity</h4> 
            <div className="cercle-modale">
            </div> 
            <button className="btn" >OUVRIR</button>

      </div>
  )
}


function Container(){
  return (
      <section className="container">    
          <Menu/>
          <div className="container-formulaire">
              <Decoration/>
          </div>
      </section>
  )
} 

function App() {
  return (
    <div className="super-container">
        <Routes>
            <Route path="./Composants/ToutesIdentite" element="<Identite/>" />
        </Routes>
        <ModalWindow/>
        <Container/>

    </div>
  );
}
export default App;
